import React, { useEffect, useState } from 'react';
import { BrowserRouter, Navigate, Route, Routes } from 'react-router-dom';
import Header from './Components/Header';
import Signup from './Components/Signup';
import Login from './Components/Login';
import Navbar from './Components/Navbar';
import { useAuthContext } from './hooks/useAuthContext';
import OwnerLogin from './Components/Owner/OwnerLogin';
import OwnerSignup from './Components/Owner/OwnerSignup';
import OwnerHome from './Components/Owner/OwnerHome';
import Home from './Components/Home';

function App() {
  const { user } = useAuthContext();
  const [check, setCheck] = useState(null);
console.log(check)
  useEffect(() => {
    const { user } = useAuthContext();
    if (user?.types === "owner") {
      setCheck("owner");
    } else if (user?.types === "user") {
      setCheck("user");
    }
  }, [user?.types, user]);

  return (
    <BrowserRouter>
      <Navbar />
      <Routes>
        <Route path="/" element={ <Header />} />
        <Route path="/Login" element={<Login /> } />
        <Route path="/Signup" element={<Signup />} />
        <Route path="/OwnerLogin" element={<OwnerLogin />} />
        <Route path="/OwnerSignup" element={ <OwnerSignup />} />
        <Route path="/Home" element={check ? <Home /> : <Navigate to="/ownerlogin" />} />
        <Route path="/OwnerHome" element={check==="owner" ? <OwnerHome /> : <Navigate to="/ownerlogin" />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
